import 'bootstrap/dist/css/bootstrap.min.css';
import React, { Fragment } from 'react';
import '/Users/micaelapaniagua/Desktop/GALO UNAHUR/ciu/club-deportivo/src/App.css';


const Footer = () => {
    return ( 
    <Fragment>    
            <div className="sponsors">
            <a href="https://www.flybondi.com"><img src="https://static.wixstatic.com/media/4b1ac6_3409907b5d6c4eecb4a3a2bf857d09ff~mv2.png/v1/fill/w_186,h_94,al_c,usm_0.66_1.00_0.01/flybondi%20chico.png"/> </a> 
            </div>
            <div className="footer2">
                <img src="https://static.wixstatic.com/media/4b1ac6_b558bb215d2b40ee8f19dd077f510c70~mv2.png/v1/fill/w_156,h_156,al_c,usm_0.66_1.00_0.01/blanco_PNG.png" alt=""/>
                <img src="https://static.wixstatic.com/media/4b1ac6_b558bb215d2b40ee8f19dd077f510c70~mv2.png/v1/fill/w_156,h_156,al_c,usm_0.66_1.00_0.01/blanco_PNG.png" alt=""/>
                <img src="https://static.wixstatic.com/media/4b1ac6_b558bb215d2b40ee8f19dd077f510c70~mv2.png/v1/fill/w_156,h_156,al_c,usm_0.66_1.00_0.01/blanco_PNG.png" alt=""/>

                <div className="redes">
                    <a href="https://www.facebook.com/depmoronoficial"><img src="https://static.wixstatic.com/media/23fd2a2be53141ed810f4d3dcdcd01fa.png/v1/fill/w_46,h_46,al_c,usm_0.66_1.00_0.01/23fd2a2be53141ed810f4d3dcdcd01fa.png" width="20px" height="20px"/> </a> 
                    <a href="https://www.twitter.com/depmoronoficial"><img src="https://static.wixstatic.com/media/01ab6619093f45388d66736ec22e5885.png/v1/fill/w_46,h_46,al_c,usm_0.66_1.00_0.01/01ab6619093f45388d66736ec22e5885.png" width="20px" height="20px"/> </a>
                    <a href="https://www.instagram.com/depmoronoficial"><img src="https://static.wixstatic.com/media/81af6121f84c41a5b4391d7d37fce12a.png/v1/fill/w_46,h_46,al_c,usm_0.66_1.00_0.01/81af6121f84c41a5b4391d7d37fce12a.png" width="20px" height="20px"/> </a> 
                </div>

            </div>
            <div className="footer"> <p>www.clubdepotivomoron.com <b>SITIO OFICIAL</b> /   ©2020 Club Deportivo Morón</p> </div>


    </Fragment>


    );
}
export default Footer;
